window.bookSummaryJSON = "<p>Boston's debauched elite is going up in flames, and it's the Fitzpatrick family that set it on fire.</p> <p><b>Hunter</b></p> <p>I didn't mean to star in a sex tape, okay?</p> <p>It was just one of those unexplainable things.</p> <p>Like Stonehenge, <i>Police Academy 2</i>, and morning glory clouds.</p> <p>It just happened.</p> <p>Now, my ball-busting father is sentencing me to six months of celibacy, sobriety, and morbid boredom under the roof of Boston's nerdiest girl alive, Sailor Brennan.</p> <p>The virginal archer is supposed to babysit my ass while I learn to take my place in Royal Pipelines, my family's oil company.</p> <p>Little does she know, that's not the only pipe I'll be laying....</p> <p><b>Sailor</b></p> <p>I didn’t want this gig, okay?</p> <p>But the deal was too sweet to walk away from.</p> <p>I needed the public endorsement; Hunter needed a nanny.</p> <p>Besides, what’s six months in the grand scheme of things?</p> <p>It's not like I'm in danger of falling in love with the appallingly gorgeous, charismatic gazillionaire who happens to be one of Boston's most eligible bachelors.</p> <p>No. I will remain immune to Hunter Fitzpatrick's charm.</p> <p>Even at the cost of losing everything I have.</p> <p>Even at the cost of burning down his kingdom.</p>"; 
